import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');

class Feed extends Component {
	constructor(props) {
		super(props);

		this.state = {

		}
	}

	get10User = () => {
		const client = new AccountClient('http://192.168.43.23:8080');
		let metadata = {
			'session_id': this.props.cookies.get('session_id')
		}
		client.getSelf(request, metadata, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				console.log(reply.User);
			}
		})
	}

	render() {
		return (
			<div>
				<this.get10User />
			</div>
		)
	}
}

export default Feed;
